import React from 'react';
import {createStore, compose, applyMiddleware} from "redux";
import {Provider} from "react-redux";
import thunk from "redux-thunk";
import rootReducer from "../../store/root-reducer";
import {Header} from "../header/Header";
import NavigationContainer from "../navigation/Navigation-container";
import TodoListContainer from "../todo-list/Todo-list-container";
import FormTodoContainer from "../form-todo/Form-todo-container";

import './app.css';

const store = createStore(rootReducer, compose(
    // applyMiddleware(thunk),
    window.__REDUX_DEVTOOLS_EXTENSION__ && window.__REDUX_DEVTOOLS_EXTENSION__())
);

function App() {
    return (
        <div className="App container">
            <Provider store={store}>
                <Header/>
                <NavigationContainer/>
                <TodoListContainer/>
                <FormTodoContainer/>
                <div className="row">
                    <div className="col s12 m5">
                        <div className="card-panel teal">
                            <label className="myCheckbox">
                                <input className='l' type="checkbox" />
                                <span></span>
                            </label>
                            <span className="white-text">I am a very simple card. I am good at containing small bits of information.</span>
                        </div>
                    </div>
                </div>

                <form action="#">
                    <p>
                        <label>
                            <input type="checkbox"/>
                            <span>-</span>
                        </label>
                        test
                    </p>
                </form>
            </Provider>
        </div>
    );
}

export default App;
